/*************************************************************************************************************
* Parameters		: ptrCntrlInfoForErrHistFIFO	--	pointer to error history info record
*
* Return			: u16UpdateErrHistStatus		--	Error history update success flag
*
* Author			: Prayas Samriya
*
* Description		:
***************************************************************************************************************/
UNSIGNED16 bkg_data_u16UpdateErrHistInfo(const UNSIGNED16* pu16CntrlInfoForErrHistFIFO)
{

	static UNSIGNED16 u16RecordIterator    = (UNSIGNED16)0;
	static UNSIGNED16 u16LoopIterator 	  = (UNSIGNED16)0;
	UNSIGNED16 u16UpdateErrHistStatus             = bkg_eeramcpy_FAILURE_D;
	static UNSIGNED16 u16PreviousErrorCode = (UNSIGNED16)0xFF;
	UNSIGNED16 u16ErrCode;
	BOOL_T blIsWrngInfoTypErr;

	/* Check if the RAM copy access is enabled */
	if(bkg_data_bDisErrHistAccess != enTRUE)
	{
		/** \MISRA_CD_DEV_START
		 * * Msg# 492: (MISRA Rule 17.4) Array subscripting applied to a function parameter declared as a pointer.
		 */
		/*PRQA S 0492++*/
		/*lint -esym(960,17.4) "Note 960 Violates MISRA 2004 Required Rule 17.4, pointer arithmetic other than array indexing used"*/
	    u16ErrCode = ((pu16CntrlInfoForErrHistFIFO[0]) & (UNSIGNED16)0x00FF);
		/*PRQA S 0492--*/
		/** \MISRA_CD_DEV_END */

	    /*Check Severity of error code*/
	    blIsWrngInfoTypErr = gfh_bChkSvrtyLvlIsWrngInfo(u16ErrCode);

		if((blIsWrngInfoTypErr == enTRUE) && (u16PreviousErrorCode == u16ErrCode ))
		{
			u16PreviousErrorCode = u16ErrCode;
			/* This error (severity - info or warning level) is already logged into FIFO,
			* no need to log it again,only sever and critical errors consecutive occurrences should
			* be logged into Error FIFO*/
			u16UpdateErrHistStatus = bkg_eeramcpy_NO_ERROR_D;
		}
		else
		{
			u16PreviousErrorCode = u16ErrCode;
			/* The record iterator keeps track of the last record updated
			 * if the update is successful then immediately the loop breaks
			 * in case the record is not updated because the last records are not in sync with the EEPROM
			 * then loopIterator checks if it can update other two records and then breaks the loop */
			for(;(((u16RecordIterator < (ERR_HIST_NUM_OF_RAM_RECORDS_D + (UNSIGNED16)1) ) && (u16UpdateErrHistStatus != bkg_eeramcpy_NO_ERROR_D))
					&& (u16LoopIterator < ERR_HIST_NUM_OF_RAM_RECORDS_D));)
			{
				/* the record iterator iterates from 1 to 4 */
				u16RecordIterator++;
				u16RecordIterator = ((u16RecordIterator) < (ERR_HIST_NUM_OF_RAM_RECORDS_D + (UNSIGNED16)1)) ? u16RecordIterator : (UNSIGNED16)1;

				/* If the is in sync with EEPROM update the record */
				if(bkg_data_asErrHistRAM_Record[u16RecordIterator - (UNSIGNED16)1].bErrHistUpdateFlag != enTRUE)
				{
					/* update the records to bkg instance */
					/** \MISRA_CD_DEV_START Msg# 4604: (MISRA Rule 20.2)The object/function 'memcpy' is being declared with the
					 * same name as an ordinary identifier defined in '<stdlib.h>'
					 * why? memcpy is not defined and just referenced
					 * Msg# 3335: (MISRA Rule 8.1)Definite: No function declaration. Implicit declaration inserted
					 * Why? memcpy is available in RTS library hence declaration is not visible
					 * */
					/*PRQA S 3335,4604++*/
					(void)memcpy(bkg_data_asErrHistRAM_Record[u16RecordIterator - (UNSIGNED16)1].pu16ErrHistParam,
											pu16CntrlInfoForErrHistFIFO,
											(bkg_data_ERR_HIST_RECORD_SIZE_WORDS_D - (UNSIGNED16)1));
					/*PRQA S 3335,4604--*/
					/** \MISRA_CD_DEV_END */
					/* raise the update flag */
					bkg_data_asErrHistRAM_Record[u16RecordIterator - (UNSIGNED16)1].bErrHistUpdateFlag = enTRUE;
					/* raise the update successful flag to break the loop */
					u16UpdateErrHistStatus = bkg_eeramcpy_NO_ERROR_D;
				}
				else
				{
					u16UpdateErrHistStatus = bkg_eeramcpy_FAILURE_D;
					/* if the current EEPROM record is not in sync with EEPROM try to fill the next record */
					u16LoopIterator++;
				}
			}
			/* loop iterator flag resets if greater than number of records */
			u16LoopIterator = (u16LoopIterator < ERR_HIST_NUM_OF_RAM_RECORDS_D) ? u16LoopIterator:(UNSIGNED16)0;

			bkg_eeramcpy_vResetErrHistSyncFlag();
		}
	}
	return(u16UpdateErrHistStatus);
}
/******************************************************************
* Parameters		: void
*
* Return			: void
