* Author			: Nikhil/Prayas Samriya
*
* Description		: Initializes the Error History record pointers
*
*******************************************************************/
static void bkg_data_vErrHistRcdInit(void)
{
	UNSIGNED16 u16ErrHistRamRcrdIterator;

	for(u16ErrHistRamRcrdIterator = (UNSIGNED16)0; u16ErrHistRamRcrdIterator < ERR_HIST_NUM_OF_RAM_RECORDS_D; u16ErrHistRamRcrdIterator++)
	{
		/*Initializes the Error History record pointers*/
		bkg_data_asErrHistRAM_Record[u16ErrHistRamRcrdIterator].pu16ErrHistParam = &bkg_data_aErrHistParam[u16ErrHistRamRcrdIterator][0];
		/*Reset Error History Update Flag*/
		bkg_data_asErrHistRAM_Record[u16ErrHistRamRcrdIterator].bErrHistUpdateFlag = enFALSE;
	}

}
