static void bkg_data_vErrHistParamArrayInit(void)
{
	UNSIGNED16 u16ErrHistRamRcrdIterator;

	for(u16ErrHistRamRcrdIterator = (UNSIGNED16)0; u16ErrHistRamRcrdIterator < ERR_HIST_NUM_OF_RAM_RECORDS_D; u16ErrHistRamRcrdIterator++)
	{
		/*Initializes the Error History parameter array*/
		utl_vMemsetU16(&bkg_data_aErrHistParam[u16ErrHistRamRcrdIterator][0], 0xFFFFu, bkg_data_ERR_HIST_RECORD_SIZE_WORDS_D);

	}

}

