* Author		:	Prayas Samriya
*
* Description	:	This function reads the serial number of valve from RamCpy
*
*/
static void bkg_data_vReadPxebSerialNumber(void)
{
	UNSIGNED16 u16Temp;
	/*lint -save -e835 A*/ /*Suppressing lint info "A zero has been given as left argument to operator"*/
	/* Update PXEB Serial Number Info - Year */
	u16Temp = (UNSIGNED16)bkg_eeramcpy_GET_ARR_U8(bkg_data_SD_SR_NUMBER_EE_ARR_HNDL_D, PXEB_SERIAL_INFO_YEAR_INDEX_D + (UNSIGNED16)1);
	bkg_data_au16PxebSerialInfo[0] =  (u16Temp & (UNSIGNED16)0x000F);
	/* Update PXEB Serial Number Info - Year */
	u16Temp = (UNSIGNED16)bkg_eeramcpy_GET_ARR_U8(bkg_data_SD_SR_NUMBER_EE_ARR_HNDL_D, PXEB_SERIAL_INFO_YEAR_INDEX_D);
	bkg_data_au16PxebSerialInfo[0] |=  ((u16Temp & (UNSIGNED16)0x000F) << (UNSIGNED16)4);

	/* Update PXEB Serial Number Info - Week */
	u16Temp = (UNSIGNED16)bkg_eeramcpy_GET_ARR_U8(bkg_data_SD_SR_NUMBER_EE_ARR_HNDL_D, PXEB_SERIAL_INFO_WEEK_INDEX_D + (UNSIGNED16)1);
	bkg_data_au16PxebSerialInfo[0] |=  ((u16Temp & (UNSIGNED16)0x000F) << (UNSIGNED16)8);
	/* Update PXEB Serial Number Info - Week */
	u16Temp = (UNSIGNED16)bkg_eeramcpy_GET_ARR_U8(bkg_data_SD_SR_NUMBER_EE_ARR_HNDL_D, PXEB_SERIAL_INFO_WEEK_INDEX_D);
	bkg_data_au16PxebSerialInfo[0] |=  ((u16Temp & (UNSIGNED16)0x000F) << (UNSIGNED16)12);

	/* Update PXEB Serial Number Info - Day */
	bkg_data_au16PxebSerialInfo[1]  = (UNSIGNED16)bkg_eeramcpy_GET_ARR_U8(bkg_data_SD_SR_NUMBER_EE_ARR_HNDL_D, PXEB_SERIAL_INFO_DAY_INDEX_D);

	/* Update PXEB Serial Number Info - Assembly Line */
	u16Temp = (UNSIGNED16)bkg_eeramcpy_GET_ARR_U8(bkg_data_SD_SR_NUMBER_EE_ARR_HNDL_D, PXEB_SERIAL_INFO_ASMBLY_INDEX_D + (UNSIGNED16)1);
	bkg_data_au16PxebSerialInfo[1] |=  ((u16Temp & (UNSIGNED16)0x000F) << (UNSIGNED16)8);
	/* Update PXEB Serial Number Info - Assembly Line */
	u16Temp = (UNSIGNED16)bkg_eeramcpy_GET_ARR_U8(bkg_data_SD_SR_NUMBER_EE_ARR_HNDL_D, PXEB_SERIAL_INFO_ASMBLY_INDEX_D);
	bkg_data_au16PxebSerialInfo[1] |=  ((u16Temp & (UNSIGNED16)0x000F) << (UNSIGNED16)12);

	/* Update PXEB Serial Number Info - Serial/Batch No */
	u16Temp = (UNSIGNED16)bkg_eeramcpy_GET_ARR_U8(bkg_data_SD_SR_NUMBER_EE_ARR_HNDL_D, PXEB_SERIAL_INFO_BATCHNO_INDEX_D + (UNSIGNED16)1);
	bkg_data_au16PxebSerialInfo[2] =  u16Temp & (UNSIGNED16)0x000F;

	/* Update PXEB Serial Number Info - Serial/Batch No */
	u16Temp = (UNSIGNED16)bkg_eeramcpy_GET_ARR_U8(bkg_data_SD_SR_NUMBER_EE_ARR_HNDL_D, PXEB_SERIAL_INFO_BATCHNO_INDEX_D);
	bkg_data_au16PxebSerialInfo[2] |=  ((u16Temp & (UNSIGNED16)0x000F) << (UNSIGNED16)4);

	/* Update PXEB Serial Number Info - Serial/Batch No */
	u16Temp = (UNSIGNED16)bkg_eeramcpy_GET_ARR_U8(bkg_data_SD_SR_NUMBER_EE_ARR_HNDL_D, PXEB_SERIAL_INFO_BATCHNO_INDEX_D + (UNSIGNED16)3);
	bkg_data_au16PxebSerialInfo[2] |=  ((u16Temp & (UNSIGNED16)0x000F) << (UNSIGNED16)8);

	/* Update PXEB Serial Number Info - Serial/Batch No */
	u16Temp = (UNSIGNED16)bkg_eeramcpy_GET_ARR_U8(bkg_data_SD_SR_NUMBER_EE_ARR_HNDL_D, PXEB_SERIAL_INFO_BATCHNO_INDEX_D + (UNSIGNED16)2);
	bkg_data_au16PxebSerialInfo[2] |=  ((u16Temp & (UNSIGNED16)0x000F) << (UNSIGNED16)12);
	/*lint -restore */
}

